  //{{{  historyAdd
  
  cwtchStruct.prototype.historyAdd = function (move, v) {
  
    if (moveIsNoisy(move))
      return;
  
    const frObj = moveFromObj(move);
    const to    = moveToSq(move);
    const h     = this.objHistory[frObj];
  
    h[to] = h[to] + v;
  
  }
  
